import 'slick-carousel';

export default {
  init() {

  },
  finalize() {
    const $carousel = $('[data-js-carousel]');
    console.log('slick');

    $carousel.slick({
      slide: '[data-js-slide]',
      arrows: false,
      infinite: true,
      speed: 750,
      fade: true,
      cssEase: 'linear',
      dots: false,
      autoplaySpeed: 4000,
    });

    $carousel.slick('play');

    const $carouselPlay = $('[data-js-carousel-buttons]');

    $carouselPlay.slick({
      slide: '[data-js-slide]',
      arrows: false,
      infinite: true,
      speed: 250,
      // fade: true,
      cssEase: 'linear',
    });

    $('[data-js-prev]').on('click', () => {
      $carouselPlay.slick('slickPrev');
    });

    $('[data-js-next]').on('click', () => {
      $carouselPlay.slick('slickNext');
    });
  },
};
